INSERT INTO `config_info` VALUES (185, 'board-gov-platform-upms-dev.yml', 'DEFAULT_GROUP', '## spring security config\nsecurity:\n  oauth2:\n    client:\n      ignore-urls:\n        - /druid/**\n\n# Datasource\nspring:\n  autoconfigure:\n    exclude: org.springframework.cloud.gateway.config.GatewayAutoConfiguration,org.springframework.cloud.gateway.config.GatewayClassPathWarningAutoConfiguration\n  datasource:\n    type: com.alibaba.druid.pool.DruidDataSource\n    druid:\n      driver-class-name: com.mysql.cj.jdbc.Driver\n      username: ${MYSQL_USER:root}\n      password: ${MYSQL_PWD:123456}\n      url: jdbc:mysql://${MYSQL_HOST:space-mysql}:${MYSQL_PORT:3306}/${MYSQL_DB:board_gov_platform}?characterEncoding=utf8&zeroDateTimeBehavior=convertToNull&useSSL=false&useJDBCCompliantTimezoneShift=true&useLegacyDatetimeCode=false&serverTimezone=GMT%2B8&allowMultiQueries=true&allowPublicKeyRetrieval=true\n      stat-view-servlet:\n        enabled: true\n        allow: \"\"\n        url-pattern: /druid/*\n        #login-username: admin\n        #login-password: admin\n      filter:\n        stat:\n          enabled: true\n          log-slow-sql: true\n          slow-sql-millis: 10000\n          merge-sql: false\n        wall:\n          config:\n            multi-statement-allow: true\n            \nfile:\n  local:\n    enable: true\n    basePath: /Users/Dell/Downloads/files\n\n# Logger Config\nlogging:\n  level:\n    com.space.intell.gas.admin.mapper: debug\nmanagement:\n  metrics:\n    tags:\n      application: ${spring.application.name}\n      namespace: ${spring.profiles.active}\n      project: infra\n  endpoints:\n    web:\n      exposure:\n        include: \"*\"\n  health:\n    consul:\n      enabled: false\n    mongo:\n      enabled: false\n    redis:\n      enabled: false\n    elasticsearch:\n      enabled: false\n  security:\n    enabled: false\n    \n# 租户表维护\nspace:\n  tenant:\n    column: tenant_id\n    tables:\n      - sys_user\n      - sys_role\n      - sys_menu