: infra\n  endpoints:\n    web:\n      exposure:\n        include: \"*\"\n  health:\n    nacos:\n      enabled: false\n    mongo:\n      enabled: false\n    redis:\n      enabled: false\n    elasticsearch:\n      enabled: false\n  security:\n    enabled: false\n\ntdengine:\n  enabled: true\n  mybatis-plus:\n    # Dynamic datasource config\n    ds:\n      key: tdengine\n      # TDEngine Mapper packages path config\n      packages: >\n        com.space.data.mybatisplus.tdengine.mapper,\n        com.space.baas.mapper.tdengine,\n        com.space.intell.gas.bff.mapper.tdengine\n    # Open TDEngine row mode\n    mode: row\nbaas:\n  client:\n    enabled: true\n  storage:\n    enabled: true\n    endpoint: http://192.168.0.120:9000\n    access-key: M2vezlAtUmtcNIqc58MD\n    secret-key: g0CzJtIpEpKZ8UoRKUBszQfcHSpQfXhvNF39Suiv\n    bucket-name: space-intell-gas-bff-buck\n\nspace:\n  intell:\n    gas:\n      zmq:\n        serverUrl: tcp://*:15557\n        clientUrl: tcp://127.0.0.1:15555\n      biz:\n        resourceUrlPrefix: http://192.168.0.120:9000\n        resourceBucket: space-intell-gas-bff-buck\n      audio:\n        audioIpList:\n          - 192.168.0.128\n          - 192.168.0.128\n          - 192.168.0.128\n        ttsMediaApi: /v1/speech\n        playMusicApi: http://192.168.0.120:9000/space-intell-gas-bff-buck/AlarmEvent/AlarmAudio\n        changeVolumeApi: /v1/volume\n        playStatusApi: /v1/play_status\n        defaultPlayVolumeSize: 50\n        maxDuplicatePlayInterval: 1\n        smokingAlarmResUri: /NoSmoking.MP3\n        phoningAlarmResUri: /NoPhoneCalls.MP3\n        fireAlarmResUri: /Fire.MP3\n        workspaceEntryAlarmResUri: /WorkspaceEntry.MP3\n        cashierLeavingAlarmResUri: /CashierLeaving.MP3\n        extinguisherCheckAlarmResUri: /FireExtinguisher.MP3\n        electroStaticClampCheckAlarmResUri: /ElectroStaticClamp.MP3\n        oilVehicleStableCheckAlarmResUri: /StableOilTime.MP3\n        noSafeHelmetCheckAlarmResUri: /SafetyHelmet.MP3\n     