\nlogging:\n  level:\n    com.space.intell.gas.admin.mapper: debug\nmanagement:\n  metrics:\n    tags:\n      application: ${spring.application.name}\n      namespace: ${spring.profiles.active}\n      project: infra\n  endpoints:\n    web:\n      exposure:\n        include: \"*\"\n  health:\n    consul:\n      enabled: false\n    mongo:\n      enabled: false\n    redis:\n      enabled: false\n    elasticsearch:\n      enabled: false\n  security:\n    enabled: false\nspace:\n  board:\n    gov:\n      sso:\n        ssoLoginUrl: http://192.168.1.116:59999/sso/login/index\n        appId: 5\n        appKey: 口岸态势总览平台1716278611969\n        appSecret: IZ7xxPZtMfEwCJ51cnEqCV+DOR/4B4FcVGOTNR0CAW3JQb0AsH6OrlE2YSpiQwOI\n        #MD5加密盐值后产生的密钥\n        encryptSalt: a3c97427bbb0eba53067e939eafbc95c\n        expireSecond: 86400\n        #约定好的公共服务器标识\n        ssoKey: sso\n        #约定好的Callback验签盐值\n        appSalt: salt2\n        #约定好的Callback加解密密钥\n        callbackPass: MEqLCnG2Q0IfauMDbZq1lP46uP4BHsiv', '157755c4e437d5c87664aa26573c12ab', '2024-07-11 10:58:25', '2024-07-11 10:58:25', 'nacos', '0:0:0:0:0:0:0:1', 'U', 'dev', '');
INSERT INTO `his_config_info` VALUES (0, 38, 'com-fang-demo-maven-dev.yml', 'DEFAULT_GROUP', '', '# 配置文件加密根密码\r\njasypt:\r\n  encryptor:\r\n    password: space001\r\n    algorithm: PBEWithMD5AndDES\r\n    iv-generator-classname: org.jasypt.iv.NoIvGenerator\r\n\r\n\r\nspring:\r\n  redis:\r\n    host: space-redis\r\n  servlet:\r\n    multipart:\r\n      max-file-size: 100MB\r\n      max-request-size: 100MB\r\n  cloud:\r\n    sentinel:\r\n      eager: true\r\n      transport:\r\n        dashboard: space_sentinel:5020\r\nfeign:\r\n  sentinel:\r\n    enabled: true\r\n  okhttp:\r\n    enabled: true\r\n  httpclient:\r\n    enabled: false\r\n    connection-timeout: 20000\r\n  compression:\r\n    request:\r\n      enabled: true\r\n    response:\r\n      enabled: true\r\n\r\n# 端点对外暴露\r\nmanagement:\r\n  endpoints:\r\n    web:\r\n      exposure:\r\n        include: \'*\'          \r\n  endpoint:\r\n    restart:\r\n      enabled: true\r\n    health:\r\n      show-details: ALWAYS\r\n\r\n#开启灰度\r\ngray:\r\n  rule:\r\n    enabled: true\r\n\r\n# mybatis-plus 配置\r\nmybatis-plus:\r\n  tenant-enable: ture\r\n  mapper-locations: classpath:/mapper/*Mapper.xml\r\n  global-config:\r\n    capitalMode: true\r\n    banner: false\r\n    db-config:\r\n      id-type: auto\r\n      select-strategy: not_empty\r\n      insert-strategy: not_empty\r\n      update-strategy: not_null\r\n  type-handlers-package:  com.space.common.data.handler\r\n  configuration:\r\n    jdbc-type-for-null: \'null\'\r\n    call-setters-on-nulls: true\r\n    shrink-whitespaces-in-sql: true\r\nmybatis-plus-join:\r\n  banner: false\r\n\r\nspace:\r\n  service:\r\n    admin: board-gov-platform-upms\r\n    auth: board-gov-platform-auth\r\n    bff: board-gov-platform-bff\r\n\r\n# swagger 全局配置\r\nknife4j:\r\n  enable: true\r\nswagger:\r\n  enabled: true\r\n  title: Space Intell Gas Swagger API\r\n  gateway: http://${GATEWAY_HOST:space-gateway}:${GATEWAY-PORT:59999}\r\n  token-url: http://${GATEWAY_HOST:space-gateway}:${GATEWAY_PORT:59999}/auth/oauth2/token\r\n  scope: server\r\n  service:\r\n    board-gov-platform-upms: upms\r\n    board-gov-platform-auth: auth\r\n    board-gov-platform-bff: bff\r\n', 'cc69beea5f2e87dfa1e936036bea12c2', '2024-07-15 11:20:03', '2024-07-15 03:20:04', NULL, '0:0:0:0:0:0:0:1', 'I', 'dev', '');
